			<pubDate>Tue, 16 Mar 2021 22:54:47 +0000</pubDate>
			<dc:creator><![CDATA[<a href="https://www.burgershot.gg/member.php?action=profile&uid=3550">helion_prime</a>]]></dc:creator>
			<guid isPermaLink="false">https://www.burgershot.gg/showthread.php?tid=1777</guid>
			<description><![CDATA[<div style="text-align: center;" class="mycode_align"><span style="font-size: xx-large;" class="mycode_size">BLAKE ISLAND v1.1</span><br />
<span style="font-size: large;" class="mycode_size">by HeLiOn PrImE</span></div>
<div style="text-align: center;" class="mycode_align">
<img src="https://i.imgur.com/e596Fbe.jpg" loading="lazy"  alt="[Image: e596Fbe.jpg]" class="mycode_img" /><img src="https://i.imgur.com/n5C0EKc.jpg" loading="lazy"  alt="[Image: n5C0EKc.jpg]" class="mycode_img" /></div>
<div style="text-align: center;" class="mycode_align"><span style="font-weight: bold;" class="mycode_b"><span style="color: #008e02;" class="mycode_color"><span style="font-size: large;" class="mycode_size">Please give a fair rate, after you check the map in game!</span></span></span></div>
<br />
<br />
<br />
<br />
<span style="font-weight: bold;" class="mycode_b">ATTENTION:</span><br />
Objects were retextured for this map.<br />
The banner only represents the island's shape from above and size.<br />
Before you rate this map, make sure you successfully load it and explore it!<br />
Location:<br />
South of Whetstone, in the middle of the ocean.<br />
<br />
<span style="font-weight: bold;" class="mycode_b">Contents:</span><ul class="mycode_list"><li>large forest areas<br />
</li>
<li>a mountain<br />
</li>
<li>beach<br />
</li>
<li>warehouses<br />
</li>
<li>shipwrecks<br />
</li>
<li>ruins<br />
</li>
<li>ghost town<br />
</li>
<li>airport<br />
</li>
<li>cabins.<br />
</li>
</ul>
<span style="font-weight: bold;" class="mycode_b">Overview:</span><br />
This is basically my first project made entirely from scratch. The making of this map very much consisted of me switching between 3 mapping tools and constantly converting everything I made.<br />
The image above shows the island without the textures. In game you will notice that all the areas are green. It's not perfect, but if some of you can do a better job, let me know and be my guest!<br />
This Island has 1/3 the surface of Los Santos and it's consisted of 707 objects. It's pretty big and has I designed it for manhunt/survival events.<br />
Scripting such an event over this map is my next step, but I really am curious of what you guys can come up with.<br />
I advise, using foggy weather and setting a low streaming/draw distance. Plus, if you're gonna throw players in those conditions, you should hide their name tags to make them invisible on the map.<br />
Hiding and planing ambushes will be easier and more fun.<br />
Below you have a set of pictures and a download link.<br />
<br />
<br />
<span style="font-weight: bold;" class="mycode_b">Install steps:</span><ul class="mycode_list"><li>place streamer.dll or streamer.so in the plugins folder<br />
</li>
<li>add "plugins streamer.so" (or streamer.dll) in your server.cfg<br />
</li>
<li>place the script in the filterscripts folder<br />
</li>
<li>add "BlakeIsland" on the filterscripts line in server.cfg<br />
</li>
<li>run the server<br />
</li>
</ul>
<span style="font-weight: bold;" class="mycode_b">Update Notes:</span><ul class="mycode_list"><li>Added a ghost town south-west of the main island.<br />
</li>
<li>Added an abandoned airfield north west of the main island.<br />
</li>
<li>Added more trees, so the forests are a bit larger.<br />
</li>
<li>Added one more lighthouse north of the main island.<br />
</li>
<li>Added bridges that connect all the island areas.<br />
</li>
<li>Added a cabin in the northern forest.<br />
</li>
<li>Remade all the textures. All the island parts now fit nicely into each-other<br />
</li>
<li>Blake Island now has 707 objects and it's 1/3 the size of Los Santos.<br />
</li>
</ul>
<br />
<span style="font-weight: bold;" class="mycode_b">Note:</span><br />
This map is coded for the use with Incognito's Streamer Plugin.<br />
The draw/streaming distances are defined in the first lines of the script. They are currently set to 350.0.<br />
The teleport command is /blake. You will be spawned at the ruins in the island core.<br />
You are allowed to modify this map to best suit your server, but you are NOT allowed to release it<br />
under your own name. If you release scripts based on this map, you are required to mention me in the credits.<br />
<br />
<span style="font-weight: bold;" class="mycode_b">Download Link:</span> <span style="font-weight: bold;" class="mycode_b">https://github.com/HeLiOn--PrImE/SAMP-Blake-Island</span>]]></description>
